import auth from '../../server/middleware/auth';
import connectDB from '../../server/config/db';

export default auth(async (req, res) => {
  await connectDB();

  console.log(req.headers, req.cookies);

  res.json('heee');
  // if (method === 'POST') {

  // }
});
